import React from "react";
import "./card_styles.css"
function Card_layout(recs) {
    
var recs = recs.recs;
console.log(recs.length);
var data = [];
var music = false
var housing = false

for(var i in recs){
    
    data.push(recs[i]);
}



if(recs.length == 0) return <div class="table-wrapper"><p>No Recommendations</p></div>

data.map((item) => (console.log(item.area)))

if(recs[0].area){
    housing = true
}
if(recs[0].album){
    music = true
}

console.log(housing);
console.log(music);

if(music){
    return(
        <div class="container">
        <div class="carousel">
        { 
                data.map((item, index) => (
                    
                        <input type="radio" name="slides" id={"slide-" + index}></input>                   
                )       
                )
            } 
            <ul class="carousel__slides">
            {                   
                data.map((item) => (
                
                <li class="carousel__slide">
                    <figure>
                        <div>
                            <img src={item.cover_url} alt=""></img>
                        </div>
                        <figcaption>
                            {item.name}
                            {item.artist}
                            {item.album}
                            
                        </figcaption>
                    </figure>
                </li>
                ))
            }
            </ul>
            <ul class="carousel__thumbnails">
            {
                    data.map((item, index) => (
                    <li>
                        <label for={"slide-" + index}><img src={item.cover_url} alt=""></img></label>
                    </li>
                    ))
                }
            </ul>
        </div>
    </div>
     
        
      )
}
if(housing){
    return(
        <div class="container">
        <div class="carousel">
        { 
                data.map((item, index) => (
                    
                        <input type="radio" name="slides" id={"slide-" + index}></input>                   
                )       
                )
            } 
            <ul class="carousel__slides">
            {                   
                data.map((item) => (
                
                <li class="carousel__slide">
                    <figure>
                        <div>
                            <img src={item.cover_url} alt=""></img>
                        </div>
                        <figcaption>
                            {item.area}
                            {item.bathrooms}
                            {item.bedrooms}
                            
                        </figcaption>
                    </figure>
                </li>
                ))
            }
            </ul>
            <ul class="carousel__thumbnails">
            {
                    data.map((item, index) => (
                    <li>
                        <label for={"slide-" + index}><img src={item.cover_url} alt=""></img></label>
                    </li>
                    ))
                }
            </ul>
        </div>
    </div>
     
        
      )
}
  


}


export default Card_layout;
